import React, { Component } from "react";

class ToDoItem extends Component {
  render() {
    const { item } = this.props;
    return (
      <div>
        <div>
          <div>
            <h3>{item.title}</h3>
          </div>
          <div>
            <h3>{item.body}</h3>
          </div>
        </div>
      </div>
    );
  }
}

export default ToDoItem;
